import React from 'react'
import MenuItem from '@skbkontur/react-ui/MenuItem'
import './Menu.css'

class Menu extends React.Component{

    render(){
        return(
            <div className="menu">
                <div className='menuItem-selected'><MenuItem>Главная</MenuItem></div>
                <div className='menuItem'><MenuItem disabled={true}>Мои курсовые</MenuItem></div>
                <div className='menuItem'><MenuItem>Свободные курсовые</MenuItem></div>

            </div>
        )
    }
}

export default Menu
